package com.github.aiosign;

import com.github.aiosign.module.request.DirectSignV2Request;
import com.github.aiosign.module.response.DirectSignV2Response;
import lombok.extern.slf4j.Slf4j;
import org.junit.Test;
import java.util.ArrayList;
import java.util.List;

/**
 * v2 签章
 *
 * @author Administrator
 * @version 1.0
 * @date 2021/3/4 10:59
 */
@Slf4j
public class SignV2Test extends AbstractSignTest {

    @Test
    public void directSign() {
        DirectSignV2Request request = new DirectSignV2Request();
        request.setContractId("b349ea382517486a2846ad02c3cc7f27");

        //填充个人信息
        List<DirectSignV2Request.PersonalInfo> personalInfoList = new ArrayList<>();
        DirectSignV2Request.PersonalInfo personalInfo = new DirectSignV2Request.PersonalInfo();
        personalInfo.setName("测试个人用户");
        personalInfo.setIdNumber("370911199001013012");
        personalInfo.setPhone("18560023412");
        personalInfo.setPageNum(1);
        personalInfo.setHorizontal(50);
        personalInfo.setVertical(80);
        personalInfo.setSealWidth(60);
        personalInfo.setSealHeight(70);
        personalInfo.setSealFileContent("");
        personalInfoList.add(personalInfo);
        request.setPersonalInfo(personalInfoList);

        //填充企业信息
        List<DirectSignV2Request.CompanyInfo> companyInfoList = new ArrayList<>();
        DirectSignV2Request.CompanyInfo companyInfo = new DirectSignV2Request.CompanyInfo();
        companyInfo.setUserId("10803992043562618880");
        companyInfo.setSealId("c4ea87f5df03713ab4c8a8082207256d");
        companyInfo.setPageNum(2);
        companyInfo.setHorizontal(50);
        companyInfo.setVertical(80);
        companyInfo.setSealWidth(60);
        companyInfo.setSealHeight(70);
        companyInfoList.add(companyInfo);
        request.setCompanyInfo(companyInfoList);

        //发起一步签署
        DirectSignV2Response execute = signClient.execute(request);
        log.info("响应状态：{}", execute.getResultCode());
        log.info("响应信息：{}", execute.getResultMessage());
        log.info("响应数据：{}", execute.getData());

    }
}
